import React, {Fragment} from 'react';
import styled from 'styled-components';

import Header from '../../components/Header';
import Footer from '../../components/Footer';
import AudioButton from '../../components/AudioButton';

const Container = styled.div`
	text-align: center;
`;

const MusicChoiceLogo = styled.img`
	margin-top: 20px;
`;

const Heading = styled.h1`
	color: #00aaf4;
	font-size: 105px;
	line-height: 105px;
	margin: 50px 0 35px 0;
	font-weight: bold;
	font-family:  cera_probold, Arial, Helvetica, sans-serif;
`;

const MainCopy = styled.p`
	color: #455051;
	font-size: 37px;
	line-height: 37px;
	max-width: 990px;
	margin: auto;
	font-weight: bold;
	font-family:  cera_prolight, Arial, Helvetica, sans-serif;
`;

const MusicButtonsRow = styled.div`
	margin-top: 60px;
	flex-flow: row nowrap;
`;

const ButtonSpacer = styled.span`
	margin-left: 45px;
`
const Footnote = styled.p`
	color: #455051;
	font-size: 18px;
	font-family:  cera_prolight, Arial, Helvetica, sans-serif;
    margin: 90px 20px 10px 20px;
`;

const listen = (props) => (
	<Fragment>
		<Header />
		<Container>
			<MusicChoiceLogo src="assets/images/music-choice.png" alt=""/>
			<Heading>
				Hear the difference!
			</Heading>
			<MainCopy>
				Use the buttons below to select a genre and discover just how great your music can sound.
			</MainCopy>
			<MusicButtonsRow>
				<AudioButton text="Rock"/>
				<ButtonSpacer />
				<AudioButton text="Jazz"/>
				<ButtonSpacer />
				<AudioButton text="Country"/>
				<ButtonSpacer />
				<AudioButton text="Hip Hop"/>
			</MusicButtonsRow>
			<img src="assets/images/volume.png" alt=""/>

		</Container>
		<Footnote>Music provided by Music Choice, <br/>available now on Contour.</Footnote>
		<Footer />
	</Fragment>
)

export default listen;
